window.bookSummaryJSON = "<p><b>Clowns, Goblins, and Erin Solstice. Not all in the same place, mind you. </b></p> <p>Erin Solstice trusts a lot of people—even some lost Redfangs survivors of Esthelm—but can she handle being friends with Goblins when every hand is turned against them and the tribes are on the rampage?&nbsp;</p> <p>Liscor is in the path of Goblin Lord's inexorable march north, and the fates of Rags, Garen Redfang, and Tremborag's Goblin tribes are all tied to an impending war. Who will survive?</p> <p>Tom the [Clown] is facing Demons in Rhir while Zel Shivertail is facing Wall Lord Ilvriss and an uncertain future. Faced with the knowledge of the Necromancer's return, who can the two Drakes turn to?</p> <p>Contains bonus content, an exclusive account of the 2nd Antinium War by famed [Writer], Krsysl Wordsmith.</p>"; 
